// SPDX-License-Identifier: MIT
// Logger
pragma solidity ^0.8.0;

import './Struct.sol';
import '@openzeppelin/contracts/access/Ownable.sol';


contract Logger is Ownable, Struct {
    
    event Bidders(address indexed marketPlace, address addressBidder, uint256 bid, uint256 listingId);
    event Buy(address indexed tokenAddress, address addressBuyer, uint256 value, uint256 tokenId, uint256 listingId);
    event Lists(address indexed marketPlace, uint256 indexed id, address owner, List list, bytes32 typeString);
    event Paiement(address indexed marketPlace, uint256 indexed _listingId, address royaltyAddress, uint256 percent);
    event Mints(address indexed tokenAddress, uint256 indexed id, address minter, uint256 quantity, bytes32 typeToken);
    event Transfer(address indexed tokenAddress, address from, address to, uint256 startTokenId, uint256 quantity, uint256 blocknumber, bytes32 typeToken);
    event TransferERC1155(address indexed operator, address indexed from, address to, uint256[] ids, uint256[] amounts, uint256 blocknumber);

    function _Bidders(address marketPlace, address addressBidder, uint256 bid, uint256 listingId) external {
        emit Bidders(marketPlace, addressBidder, bid, listingId);
    }

    function _Buy(address tokenAddress, address addressBuyer, uint256 value, uint256 tokenId, uint256 listingId) external {
        emit Buy(tokenAddress, addressBuyer, value, tokenId, listingId);
    }

    function _Lists(address marketPlace, uint256 id, address owner, List memory list, bytes32 typeString) external {
        emit Lists(marketPlace, id, owner, list, typeString);
    }

    function _Paiement(address marketPlace, uint256 _listingId, address royaltyAddress, uint256 percent) external {
        emit Paiement(marketPlace, _listingId, royaltyAddress, percent);
    }

    function _Mints(address tokenAddress, uint256 id, address minter, uint256 quantity, bytes32 typeToken) external{
        emit Mints(tokenAddress, id, minter, quantity, typeToken);
    }

    function _Transfer(address tokenAddress, address from, address to, uint256 startTokenId, uint256 quantity, uint256 blocknumber, bytes32 typeToken) external{
        emit Transfer(tokenAddress, from, to, startTokenId, quantity, blocknumber, typeToken);
    }

    function _TransferERC1155(address operator, address from, address to, uint256[] memory ids, uint256[] memory amounts, uint256 blocknumber) external{
        emit TransferERC1155(operator, from, to, ids, amounts, blocknumber);
    }

}
